Vi multiplicerer polynomet $(3t^2+5t+a)$ med polynomet $(4t^2+bt-2)$ og comparerer koeffisientene i det resultante polynomet med koeffisientene i polynomet $12t^4+26t^3-8t^2-16t+6$. Vi har at
\begin{align*}
(3t^2+5t+a)(4t^2+bt-2) &= 12t^4+3bt^3-6t^2+20t^3+5bt^2-10t+4at^2+abt-2a\\
&= 12t^4+(3b+20)t^3+(4a+5b-6)t^2+(ab-10)t-2a.
\end{align*}
Vi ser at $-2a=6$, dvs. $a=-3$. Vi har at $ab-10=-16$, dvs. $b=-6$. Så $a+b=-3+(-6)=\boxed{-9}$.
